[{'id_oferta': '239', 'url_oferta': 'https://www.unasus.gov.br/cursos/oferta/239', 'codigo_oferta': '239', 'vagas': '300', 'publico_alvo': 'O público-alvo são profissionais de nível superior vinculados a órgãos públicos de saúde e outros com atuação em desastres ou área correlata, em nível acadêmico, administrativo ou técnico.', 'local_oferta': 'EAD', 'formato': 'Ensino a Distância', 'programas_governo': 'UNA-SUS', 'temas': '', 'decs': 'SP4::Saúde Ambiental, SP8.473::Risco, SP8::Desastres', 'descricao_oferta': 'O Curso de Saúde, Desastres e Desenvolvimento se fundamenta na crescente demanda dos profissionais do Sistema Único de Saúde (vigilância em saúde: ambiental, sanitária e epidemiológica; atenção à saúde; engenharia de saúde pública; assistência farmacêutica, logística, entre outros.), das três esferas de governo, de outros órgãos públicos, especialmente Meio Ambiente, da Defesa Civil, de Bombeiros e da Academia.

Possui como objetivo fundamental formar profissionais para atuarem intra e inter setorialmente na gestão do risco e preparação do setor saúde para enfrentar os desastres.

O público-alvo são profissionais de nível superior vinculados a órgãos públicos de saúde e outros com atuação em desastres ou área correlata, em nível acadêmico, administrativo ou técnico.

Os objetivos específicos do curso são:

Oferecer conhecimentos e ferramentas que permitam formular e implementar planos e programas de redução do risco de desastres;
Proporcionar ao profissional que atua em desastres uma visão mais ampla de atuação e das conseqüências de um desastre;
Entender as responsabilidades do Setor Saúde em situações de desastres;
Fortalecer as capacidades técnicas, especialmente nos âmbitos municipal e estadual frente a uma demanda crescente desse aprendizado exclusivo;
Atingir um maior número de alunos num curto espaço de tempo;
Facilitar mecanismos de coordenação inter e intrasetorial e multidisciplinar;
Fomentar a construção de comunidades virtuais e espaço de diálogo e intercâmbio de experiências; 
Desenvolver estratégias eficientes para fortalecer os processos na tomada de decisões;
Aprimorar a capacidade de resposta às emergências de relevância para o Brasil;
Apoiar a formulação e elaboração de planos de gestão do risco.', 'palavras_chave': 'desastres, gestão do risco, saúde ambiental', 'id_curso': 71}]

